def get_percent(name,pic_size,pix):
    standard=standard_dict[name]
    width_n,height_n=len(standard[0]),len(standard)
    width_p,height_p=pic_size

    min_width,min_height=min(width_n,width_p),min(height_n,height_p)
    tmp=[0]*4
    for x in range(min_width):
        for y in range(min_height):
            if standard[y][x]==pix[x,y]:
                tmp[0]+=1
            if standard[y+height_n-min_height][x]== \
               pix[x,y+height_p-min_height]:
                tmp[1]+=1
            if standard[y][x+width_n-min_width]== \
               pix[x+width_p-min_width,y]:
                tmp[2]+=1
            if standard[y+height_n-min_height][x+width_n-min_width]== \
               pix[x+width_p-min_width,y+height_p-min_height]:
                tmp[2]+=1
    max_match=reduce(lambda x,y:x+y,tmp)
    #max_match=max(tmp)

    return max_match

def identify_pic(pic_name):
    im=Image.open(pic_name)
    pix=im.load()

    max_match,percent='',0.0
    for name in '0123456789ABCDEFGHIJKLMNOPQRSTUVWXYZ':
        if standard_dict.has_key(name):
            tmp=get_percent(name,im.size,pix)
            if tmp>=percent:
                max_match,percent=name,tmp

    return max_match

if __name__=='__main__':
    print (identify_pic('281_3.png'))
